
var KalturaNotificationService={initiateCleanup:function(){var kparams=new Object();return new KalturaRequestBuilder("notification","initiateCleanup",kparams);},register:function(identifier,type){var kparams=new Object();kparams.identifier=identifier;kparams.type=type;return new KalturaRequestBuilder("notification","register",kparams);},setDevicePushToken:function(pushToken){var kparams=new Object();kparams.pushToken=pushToken;return new KalturaRequestBuilder("notification","setDevicePushToken",kparams);}}